import React from 'react';

function LegalNoticeFooter() {
  return (
    <footer className="app-footer" role="contentinfo">
      <div className="footer-inner">
        <p className="footer-line">© 2025 ToolBox by hoowave. All rights reserved.</p>
        <p className="footer-line">본 서비스는 쿠팡이츠 관리자를 위한 용도로 제작되었습니다.</p>
      </div>
    </footer>
  );
}

export default LegalNoticeFooter;
